package com.sing.ren.pojo;public class CoursesTime extends BasePOJO{	private Integer id;	private String intervalTime;	private String startTime;	private String endTime;	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public String getIntervalTime() {		return intervalTime;	}	public void setIntervalTime(String intervalTime) {		this.intervalTime = intervalTime;	}	public String getStartTime() {		return startTime;	}	public void setStartTime(String startTime) {		this.startTime = startTime;	}	public String getEndTime() {		return endTime;	}	public void setEndTime(String endTime) {		this.endTime = endTime;	}}